import React from 'react'
import '../css/offer.css'

const Offer = (props) => {
  return (
    <div className='offer'>
      <h5>{props.title}</h5>
      <p className='time'>25-40 minutes</p>
      <p className='price'>29$</p>
      <a href='#'>Book An Appointment</a>
    </div>
  )
}

export default Offer
